INSERT INTO `fotos` VALUES (1,'Broka','<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>','v1549106916/rtandrew-site/fotos/Motocross/IMG_3982.jpg','broka',1,44,NULL,'2022-11-28 13:31:50'),(2,'Vitória ou Derrota','<p>Enquanto toda gente estava entretida a celebrar o evento, estava este corredor no seu canto bem pausado com uma cara meio que triste.</p>\r\n<p>Pensei que ele poderia sorrir caso eu fosse junto de si para lhe fotar. S&oacute; que n&atilde;o. Aquela carinha continuou a mesma. Olhei para a camera, olhei para ele, e sorri. Agachei para tirar outra foto. Notei que ele n&atilde;o havia mudado a sua pose, ent&atilde;o, pedi-lhe para que sorrisse, j&aacute; que ele tinha havia ganhado uma ta&ccedil;a. Em um gesto de abano com cabe&ccedil;a, ele sorriu ligeriamente, mas s&oacute; ligeiramente mesmo, e limitei-me a aproveitar para tirar aquela foto.</p>\r\n<p>Esta foto faz-me pensar muito sobre as nossas conquistas n&atilde;o celebradas. Alguns n&atilde;o celebram com medo de incomodar o infortuno, outros porque ainda falta muito para o objectivo geral. De qualquer forma, uma conquista &eacute; uma conquista. E cantar a sua vit&oacute;ria sabe bem. Muito bem.</p>','v1549106865/rtandrew-site/fotos/Motocross/IMG_3976.jpg','vitoria-ou-derrota',1,39,NULL,'2022-10-24 10:42:42'),(3,'O Chefe','<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>','v1549106291/rtandrew-site/fotos/Motocross/IMG_4002-2.jpg','o-chefe',0,35,NULL,'2022-11-28 11:04:13'),(4,'Team Orbel, A Box dos Campões','<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>','v1549106905/rtandrew-site/fotos/Motocross/IMG_3897.jpg','team-orbel-a-box-dos-campoes',0,39,NULL,'2022-11-29 02:33:03'),(5,'\"Anfintriões\"  PT.1','<p>Este &eacute; o senhor Jo&atilde;o, um campon&ecirc;s humilde, habitante do bairro Bita Tanque que faz o seu trabalho todos os dias nas lavras do Tombo.&nbsp;&nbsp; <br />O Sr. Jo&atilde;o acorda, na maioria dos dias, &agrave;s 4:30 e outras &agrave;s 5:30 quando for seu dia de folga. Tudo isto junto da sua esposa Laurinda, a quem ganhei a confian&ccedil;a de chamar-lhe carinhosamente de Dona Lau.</p>','v1547050641/rtandrew-site/fotos/O%20Rio%20Que%20Movimenta%20Esp%C3%ADritos/IMG_4511.jpg','anfintrioes-pt-1',0,36,'2019-02-01 17:52:00','2022-11-30 04:36:08'),(6,'\"Anfintriões\" PT.2','<div>No &uacute;ltimo ano, o Sr. Jo&atilde;o tem tido como primordial foco n&atilde;o s&oacute; a restaura&ccedil;&atilde;o das lavras mas tamb&eacute;m a cria&ccedil;&atilde;o da mesma em lugares pr&oacute;ximos.&nbsp;</div>\r\n<div>Embora que o trabalho seja feito com apenas alguns equipamentos, &eacute; com a enxada, o seu instrumento favorito, que o trabalho &eacute; bem feito.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Manh&atilde;s ensolaradas, tardes ardentes, o seu mantimento &eacute; o que a terra lhe vir a oferecer. Desde a mandioca at&eacute; a batata doce, acompanhado com um bidon de &aacute;gua bem gelado para refrescar o corpo e continuar o seu of&iacute;cio e poder assim terminar o dia.</div>','v1547050453/rtandrew-site/fotos/O%20Rio%20Que%20Movimenta%20Esp%C3%ADritos/IMG_4513.jpg','anfintrioes-pt-2',1,39,'2019-02-01 18:09:00','2022-11-29 09:24:00'),(7,'\"Anfintriões\"  PT.3','<p>&nbsp; A Dona Lau &eacute; uma pessoa fant&aacute;stica e super am&aacute;vel. Embora n&atilde;o gostar muito de fotos, foi ela mesmo quem incentivou o seu esposo a ser fotografado enquanto trabalhasse. E mesmo ap&oacute;s pedidos dele para que se juntasse para fazerem uma foto de casal, ela respondia:</p>\r\n<p style=\"padding-left: 30px;\"><em>- N&atilde;o, Jo&atilde;o. Vai voc&ecirc;!</em></p>\r\n<p>Ela &eacute; respons&aacute;vel por todo o tipo de plantas. &Eacute; quem decide quando a colheita deve ser feita ou quando as plantas devem ser mudadas de lavras, a fim de n&atilde;o morrerem devido &agrave; seca ou at&eacute; mesmo ao encharque (&eacute;poca de chuva). <br />Como a dona Lau n&atilde;o gostava que a camera se aproximasse de si, tive ent&atilde;o de fazer uma &uacute;ltima tentativa com o telem&oacute;vel para capturar um peda&ccedil;o da sua rotina, que no exacto momento ela segurava em sua m&atilde;o rama de batata.</p>\r\n<p>E foi gra&ccedil;as ao incentivo da Dona Lau, pude fotar o Sr. Jo&atilde;o sem qualquer problema. Quando me dirigi a ele, o Sr. Jo&atilde;o - com um jeito engra&ccedil;ado e brusco - desfez-se de tudo em sua posse e colocou-se em <em>posi&ccedil;&atilde;o</em> <em>de sentido, </em>e olhou directamente para o obturador sem qualquer medo.</p>','v1547050483/rtandrew-site/fotos/O%20Rio%20Que%20Movimenta%20Esp%C3%ADritos/IMG_4501-Edit-2.jpg','anfintrioes-pt-3',1,54,'2019-02-01 18:11:00','2022-10-23 04:15:41'),(8,'\"Anfintriões\"  PT.4','<p>Todo aquele momento era surreal, e por acaso, eu havia deixado o telem&oacute;vel a gravar tudo aquilo... Mas infelizmente perdi a grava&ccedil;&atilde;o.</p>\r\n<p>O mood estava bu&eacute; fixe. Eu estava me sentir fixe e aquilo estava a me cuiar bu&eacute;. Era clicks atr&aacute;s de clicks. Pequenos ajustes na c&acirc;mera e depois click! Trocar de posi&ccedil;&atilde;o e depois click!<br />Em momento algum endireitei ou pedi para que o Sr. Jo&atilde;o mudasse de posi&ccedil;&atilde;o. Casos como este &eacute; sempre melhor fotar tal como est&aacute;, e deixar que o ambiente e a criatividade assumam. E tamb&eacute;m, &eacute; uma forma de respeito.</p>','v1547050598/rtandrew-site/fotos/O%20Rio%20Que%20Movimenta%20Esp%C3%ADritos/IMG_4503-Edit-2.jpg','anfintrioes-pt-4',0,52,'2019-02-01 18:13:00','2022-11-28 07:08:26'),(9,'\"Meninos do Tombo\"','<div>Prosseguindo o meu caminho, depois de ter parado nas lavras junto ao rio e pedir orienta&ccedil;&otilde;es de trilha, deparei-me com estes quatro meninos. Todos eles carregavam cada dois bid&otilde;es pequenos de &aacute;gua. Ao contr&aacute;rio dos outros meninos que j&aacute; me tinha deparado, estes eram muito t&iacute;midos e um bocadinho assustados - diria.&nbsp;</div>\r\n<div>Perguntei-lhes se estava a seguir o caminho correcto, e um deles - que parecia conhecer melhor do que os restantes - respondeu que n&atilde;o. Que o caminho era o que j&aacute; havia passado.&nbsp;</div>\r\n<div>Antes de ir, perguntei se podia \"lhes fotar\". De novo, com algum receio, eles olharam-se um para os outros e passar um compasse de segundos responderam que sim.&nbsp;</div>\r\n<p>Aproveitei e tirei alguns shots. Contudo, todos pareciam estar de uma certa forma \"errados\", pois n&atilde;o estava a conseguir captar o que os meus olhos estavam a ver. Como j&aacute; estava mesmo com pressa, tirei s&oacute; mais tr&ecirc;s fotos adicionais para arrumar o assunto...</p>','v1547050452/rtandrew-site/fotos/O%20Rio%20Que%20Movimenta%20Esp%C3%ADritos/IMG_4535-2.jpg','meninos-do-tombo',1,41,'2019-02-01 18:15:00','2022-10-24 13:04:10'),(10,'A Solenidade Do Rio PT.1','<p>Logo depois de ter conversado e ter feito as fotos, o casal teve de dar ent&atilde;o a continuidade do seu trabalho.<br />A despedida foi calorosa e cheio de abra&ccedil;os entre eu e a Dona Lau. N&atilde;o havia como me despedir apropriadamente do Sr. Jo&atilde;o, porque ele j&aacute; havia se metido no meio da planta&ccedil;&atilde;o.<br />A Dona Lau gritou-lhe:</p>\r\n<p style=\"padding-left: 30px;\">- Jo&atilde;o!!! O menino est&aacute; mbora a ire*.<br />- Tamb&eacute;m ent&atilde;o. Vai bem - respondeu o Sr. Jo&atilde;o.<br />- J&aacute; estou a ir, Sr. Jo&atilde;o. Fique bem - gritei-lhe eu.<br />- Tchau! Obrigado pelas fotos - gritou o Sr. Jo&atilde;o.</p>\r\n<p>E ficamos todos aos gritos, a nos despedir calorosamente...<br />A Dona Lau e eu ainda estavamos a sair da planta&ccedil;&atilde;o para nos aproximarmos do trilho. Ela n&atilde;o parava de sorrir, tal como eu.</p>\r\n<p style=\"padding-left: 30px;\">- Adeus, Dona Lau. Foi um prazer!<br />- Vai ent&atilde;o bem, yha!? N&oacute;s vamos mbora trabalhar. Tem muito trabalho.<br />- T&aacute; bem. Tchau tchau. Adorei bu&eacute;.</p>','v1547050449/rtandrew-site/fotos/O%20Rio%20Que%20Movimenta%20Esp%C3%ADritos/IMG_4476-HDR.jpg','a-solenidade-do-rio-pt-1',1,53,'2019-02-02 10:03:00','2022-11-30 07:39:34'),(11,'A Solenidade Do Rio PT.2','<p>Depois dos gritos de despedidas calorosas, peguei na bicicleta e fui pelo caminho oposto para ver se fotava os mambos interessantes (mas n&atilde;o havia nada).<br />Regressei de onde sa&iacute;ra, aproximei-me ao rio e encostei-me num pequeno desn&iacute;vel - posso assim dizer. Abri a pasta para me hidratar e alimentar. Enquanto isto, e sem me aperceber, estava eu na companhia da solenidade do rio e de todos os seres ao seu redor.<br />O rio movia-se lentamente, tal igual &agrave;s nuvens do c&eacute;u, arrastando com sua corrente troncos, ramos, e plantas que se encontrassem pr&oacute;ximo &agrave; beira. Pequenos caranguejos saiam do rio para espreitar a terra, as gaivotas sobrevoavam o rio para atacar os peixes, e barulho dos grilhos n&atilde;o cessava.<br />Era muito lindo estar no meio daquilo tudo. Era majestoso e surreal para aquele espelho d\'&aacute;gua.<br /><br />N&atilde;o me deixei ficar muito confort&aacute;vel, pois, ainda tinha muito o que percorrer. Neste dia percorri 55,71 quil&ocirc;metros com um tempo total de 7h29min. <br />Aqui fica o link do strava para quem quiser fazer esta aventura de BTT.&nbsp; <a title=\"Link da actividade do Strava de BTT\" href=\"https://www.strava.com/activities/1469097383\" target=\"_blank\" rel=\"noopener noreferrer\">Link da actividade no strava.</a></p>\r\n<p>&nbsp;</p>','v1547050408/rtandrew-site/fotos/O%20Rio%20Que%20Movimenta%20Esp%C3%ADritos/IMG_4466.jpg','a-solenidade-do-rio-pt-2',1,47,'2019-02-02 10:06:00','2022-11-29 16:22:46'),(12,'Kambas da Bicicleta PT.1','<p>Nunca hei de me esquecer do meu primeiro dia em a fazer BTT de verdade. Foi neste dia que tamb&eacute;m tive o meu primeiro empeno, garantido e assinado pelos Kambas da Bicicleta.&nbsp;</p>\r\n<p>O trajecto era de 64km, saindo do Zango 2, passando pelo Bom Jesus e pelo Rio Kwanza.</p>\r\n<p>Durante o percuso n&atilde;o se notava o ar quente e polu&iacute;do da cidade. Tudo era muito verde, apesar da terra &aacute;rida, mas ainda assim se podia desfrutar da vista. Planta&ccedil;&otilde;es em quase todo percurso, grandes terrenos abertos, animais...Foram tantas as vezes que apanhei um orgasmo s&oacute; de ver tanta beleza.</p>\r\n<p>&nbsp;O empeno foi t&atilde;o forte que perdi o trajecto, e fui parar nas Bombas da Sonangol, onde tive de esperar pela boleia do Tommy. O recepcionista foi bu&eacute; porreiro e me deixou estar &agrave; vontade, no qual preferi deitar no ch&atilde;o e n&atilde;o me levantar mais.</p>','v1547049813/rtandrew-site/fotos/BroTT/20160604_133824.jpg','kambas-da-bicicleta-pt-1',0,52,'2019-02-03 22:59:00','2022-10-24 18:23:35'),(13,'Kambas da Bicicleta PT.2','<p>Este &eacute; o carro (LamborJIMMY) do Tommy, aka o <strong><em>Comandante em Chefe, </em></strong>de volta para a cidade depois dos 64km na companhia dos <strong>Kambas da Bicicleta. </strong>J&aacute; agora, aproveito mandar um holla aos KB por nos acolherem em seu territ&oacute;rio, e por serem umas das equipas a impulsionar o ciclismo e o BTT em Angola.</p>\r\n<p>O Tommy recebeu o convite do Crispim (membro dos KB) para pedalar com eles. O problema &eacute; que n&atilde;o tinhamos um <em>Porta Bicicletas. </em>Mas como somos mbora mwangole, o Tommy n&atilde;o mayou e pediu ajuda de um serralheiro para que fizesse uma imita&ccedil;&atilde;o dum <em>Porta Bicicletas </em>usando ferros. Como a cena era de ferro, aquilo poderia danificar as bicicletas. O Tommy, uma vez mais, teve a brilhante ideia de envolver os ferros com c&acirc;mara de pneu. E adviinha?! <strong>Funcionou!! </strong> Apesar de ainda assim as bicicletas terem ficado com arranh&otilde;es. ? ?</p>\r\n<p>Saindo da Samba para o Zango II, confesso que estava aterrorizado da minha bicicleta poder cair na Via Expressa, j&aacute; que eram 05hr57min &agrave; 130km/hr.</p>','v1547049890/rtandrew-site/fotos/BroTT/20160604_134408.jpg','kambas-da-bicicleta-pt-2',0,64,'2019-02-03 23:13:00','2022-11-29 20:27:08'),(14,'Expedição dos Bairros Bita','<p>Logo ao passar pela porta que d&aacute; acesso aos trilhos do Tombo - isso mesmo! H&aacute; uma esp&eacute;cie de porta... - perguntei a um senhor se aquele era o caminho correcto (a intui&ccedil;&atilde;o dizia-me que sim e eu n&atilde;o quis dar uma olhada no GPS). Ele disse sim, e logo de seguida perguntou o que haveria eu de fazer no Rio. Respondi-lhe que iria apenas fotar e depois estava com planos de ir pro Quizele II. <br />Depois de saber que as minhas actividades n&atilde;o eram suspeitas, n&atilde;o s&oacute; voltou a afirmar que o caminho era correcto mas como tamb&eacute;m advertiu para que n&atilde;o desse um mergulho. J&aacute; que o \"<strong><em>rio n&atilde;o gosta de visitas</em></strong>\". <br />Assustei-me um pouquinho, mas n&atilde;o seria grande coisa... - pensava eu.<br /><br />Como j&aacute; era a minha segunda vez naqueles trilhos, j&aacute; sabia muito bem o que haveria de enfrentar. Devido as grandes chuvas que ca&iacute;ram na banda, o ar por l&aacute; estava muito mais fresco e leve. Tudo estava muito mais verde, e os capins altos batendo forte nas minhas pernas... Nuvens gordas como se fossem de algod&atilde;o preenchiam o c&eacute;u azul claro, permitindo ver mesmo &agrave; dist&acirc;ncia os passarinhos que sobrevoavam a &aacute;rea. Aquilo era como se fosse respirar a liberdade.&nbsp; <br />Depois de contemplar a vista, estava na hora de fazer um pouco de \"<em>downhill</em>\". E para a minha surpresa, a m&uacute;sica do telefone mudou para a m&uacute;sica dos <strong><em>Racionais - Jesus Chorou (live)</em></strong>. <br />F******. De um momento para o outro me senti mais livre do nunca!! Eu ia gritando a letra da m&uacute;sica (\"<em>corre vagabundo, vo\' te fala</em>\") &agrave; alta velocidade j&aacute; que n&atilde;o havia ningu&eacute;m na trilha para me parar.</p>','v1547050381/rtandrew-site/fotos/BroTT/IMAG0629-Edit-Edit-2.jpg','expedicao-dos-bairros-bita',1,93,'2019-02-03 23:31:00','2022-11-28 12:17:07'),(15,'O Rio que Alimenta os Bairros Bita PT.2','<p>Assim que cheguei numa zona mais plana, os capins eram t&atilde;o altos que seguir os trilhos era uma tarefa mais dif&iacute;cil, at&eacute; que uma certa altura o capim atolou o meu&nbsp;<em>derailleur</em>, e deixou as minhas pernas cheias de arranh&otilde;es.&nbsp;</p>\r\n<p>N&atilde;o obstante, o mapa n&atilde;o mostrava os trilhos, e por isso me vi obrigado a olhar para a vers&atilde;o do mapa sat&eacute;lite. O sat&eacute;lite apresentou uma forma muito bizarra de chegar mais pr&oacute;ximo ao rio, e para ser sincero era sinistro. O barulho dos animais, o barulho do capim quando os animais notassem pela minha aproxima&ccedil;&atilde;o... tudo aquilo me apavorava.</p>\r\n<p>Mas prontos. Depois de andar &agrave;s voltas, decidi seguir um trilho que quase n&atilde;o se via, e que para minha surpresa, cheguei bem pr&oacute;ximo ao rio onde avistei uma bomba de &aacute;gua usada para irrigar as planta&ccedil;&otilde;es ao redor (por&eacute;m, n&atilde;o avistei sequer uma).</p>','v1547050286/rtandrew-site/fotos/BroTT/IMAG0640-Edit-Edit.jpg','o-rio-que-alimenta-os-bairros-bita-pt-2',0,108,'2019-02-03 23:42:00','2022-10-23 04:09:17'),(16,'O Rio que Alimenta os Bairros Bita PT.1','<p>Eram quase 10hr, quando o sol escaldante decidiu aparecer repentinamente.</p>\r\n<p>Do outro lado do rio, notei que havia um senhor que entrava e sa&iacute;a constantemente de sua cubata. Parecia imposs&iacute;vel, e me perguntei como ele conseguiu chegar at&eacute; a&iacute;...</p>','v1547050281/rtandrew-site/fotos/BroTT/IMAG0645.jpg','o-rio-que-alimenta-os-bairros-bita-pt-1',0,100,'2019-02-03 23:46:42','2022-10-25 04:39:25'),(21,'Luis Ubuntu, o meu Idris Elba','<p>Este &eacute; o Luis da Silva Ubuntu (<a title=\"Instagram\" href=\"https://www.instagram.com/luisdasilva583/\" target=\"_blank\" rel=\"noopener noreferrer\">Instagram</a>), meu colega e amigo das confian&ccedil;as. O Lu&iacute;s &eacute; um dos muitos a quem aprecio bastante. Ele escreve, fotografa e, claro, tamb&eacute;m gosta de ser fotado.<br />Era um dia normal, um dia de defesa da cadeira de Base de Dados, logo, tivemos de estar apresent&aacute;veis. Ap&oacute;s a defesa e termos feito fotos com a turma e o professor, de algum modo o Lu&iacute;s pareceu-me insatisfeito e queria fazer fazer mais fotos (j&aacute; mencionei que o ele gosta de roubar a ribalta?!).<br />Ent&atilde;o, ele sugeriu que f&ocirc;ssemos para um canto da FAU que ele conhecia bem. Quando l&aacute; chegamos, fiquei surpreso pelo local. Era calmo, com algumas &aacute;vores que ajudavam com as sombras e arejava muito bem.<br />Depois de averiguarmos o espa&ccedil;o e estud&aacute;-lo, fomos directamente para a pr&aacute;ctica, no qual a c&acirc;mera seria a do Lu&iacute;s e se bem me lembro era Canon. Como n&atilde;o tenho jeito para ser fotado, peguei logo no mambo e comecei a brincar com ela at&eacute; me habituar...shots no sol, shots no ch&atilde;o, ajuste do ISO, shot na &aacute;rvore e mais outros ajustes.<br />Como sempre, gosto de deixar a pessoa mais confort&aacute;vel poss&iacute;vel, procurei p&ocirc;r uma conversa com o Lu&iacute;s para ver se ele ficava mais confort&aacute;vel (o Lu&iacute;s era nato e j&aacute; sabia que fazer). Quando se trata de fotar, gosto da naturalidade do corpo, sem muitas posi&ccedil;&otilde;es preparadas... e caso estiver a pensar em alguma, tento fazer que a pessoa em quest&atilde;o entenda o que pretendo.<br /><br /></p>','v1547049421/rtandrew-site/fotos/Insolitus/luis-ubuntu-idris-elba.jpg','luis-ubuntu-o-meu-idris-elba',1,99,'2019-02-20 05:06:00','2022-10-23 03:35:17'),(31,'Entre a Luz e a Sombra','<p>Meu corpo est&aacute; fundido tanto de luz e de escurid&atilde;o<br />Contudo, escolho caminhar entre as suas sombras<br />narrando por cima de fotografias e escritas<br />sobre a mis&eacute;ria (ou div&iacute;cia) entre os dois mundos.</p>\r\n<p>In Frame: <a class=\"notranslate\" title=\"Luis Ubuntu\" href=\"https://www.instagram.com/luisdasilva583/\" target=\"_blank\" rel=\"noopener noreferrer\">Luis Ubuntu</a></p>','v1547049460/rtandrew-site/fotos/Insolitus/entre-a-luz-e-a-sombra.jpg','entre-a-luz-e-a-sombra',0,82,'2019-02-20 05:17:00','2022-11-30 09:42:17'),(41,'Largo do Ambiente','<p>O Largo do Ambiente &eacute; um daqueles lugares da cidade de Luanda para se desfrutar o p&ocirc;r do sol, na companhia dos ventos e das mais diversas cores embatem as janelas dos edif&iacute;cios daquele lugar. De noite, o Largo do Ambiente transforma-se num lugar sossegado, e &eacute; nesta altura em que mais o aprecio e torna-se mais significante para mim. </p>\r\n<p>Pr&oacute;ximo &agrave; Torre do Ambiente, nota-se pessoas - jovens na sua maioria - que procuram por um t&aacute;xi que v&aacute; para o Miramar, S&atilde;o Paulo ou Sambizanga. Mais acima, bem na esquina do Edif&iacute;cio da Total, mo&ccedil;as de curtinhos, algumas bonitas com atributos atractivos, enfrentam o frio e colocam a sua seguran&ccedil;a em risco na esperan&ccedil;a de que algu&eacute;m compre o seu producto. Enquanto que bem no centro do Largo, meninos deitados no ch&atilde;o com cobertas de papel&atilde;o, repousam os seus corpos exaustos para que possam enfrentar mais um dia na Metr&oacute;pole, vagueando pedindo por ajuda, lavar carros ou arranjar um outro meio de fazer dinheiro (aqueles que j&aacute; estacionaram os seus carros na Marginal h&aacute; 8 anos sabem o que quero dizer).</p>','v1547050165/rtandrew-site/fotos/Luanda/largo-do-ambiente.jpg','largo-do-ambiente',1,106,'2019-03-07 12:31:58','2022-11-28 15:25:30'),(51,'It\'s a Leak Pt.1','<p>Neste dia estava eu a brincar com a c&acirc;mera do Lu&iacute;s at&eacute; pegar o jeito da coisa. Shots daqui, shots dali, ajuste no ISO, um shot...prontos voc&ecirc;s devem perceber. <br />Enquanto fazia fotos aleat&oacute;rias, a Od&iacute;lia (a jovem linda na foto) aproximou-se e decidi brincar com um bocadinho ela. E tal como todas as mulheres, ela ficou um bocadinho chateada por ser apanhada desprevenida</p>\r\n<p style=\"padding-left: 30px;\"><em>\'tas a ver quando apontas a c&acirc;mera ou um telefone numa dama e quando ela apercebe-se solta um sorriso seguido duma pose? Yha, ela bem que tentou, mas j&aacute; ia tarde</em>.</p>\r\n<p>Tentei uma vez mais com ela j&aacute; preparada, e, prontos, ela come&ccedil;ou a reagir com poses (lol). Pegar na orelha, olhar para baixo, endireitar o casaco...<br />Ela foi interrompida algumas vezes, mas n&atilde;o foi por isso que parei de fotar. Continuei numa boa, at&eacute; porque eu queria era mais espontaneidade (algo que n&atilde;o sei fazer acontecer por meio de &acirc;ngulos).<br /><br />Quando acabei por selecionar as imagens para come&ccedil;ar a editar, notei que apenas duas fotos eram poses preparadas. Havia pouca luz, havia ru&iacute;dos na imagem, e para estragar ainda mais, as paredes e as vitrines estavam sujam. Cenas que compremeteram o mambo todo. Mas prontos, ainda tive o good ol\' black and white to the rescue. :-)<br /><br /></p>','v1547049107/rtandrew-site/fotos/Insolitus/its-a-leak-1.jpg','its-a-leak-pt-1',0,153,'2019-03-13 23:47:00','2022-10-23 04:17:55'),(61,'O Olhar da Concorrência','<p>Neste dia a competi&ccedil;&atilde;o de Motocross estava no seu auge e a popula&ccedil;&atilde;o ao rubro. No meio disto, a malta da copa - dentre eles pessoal chegado aos atletas - assistia com bastante apreensividade, apontado aos erros que eles cometiam durante a prova. <br />Para melhorar, o sol n&atilde;o parecia t&atilde;o cedo abrandar. O que s&oacute; restava nos aconchegar numa banda que tivesse o m&iacute;nimo de sombra poss&iacute;vel, partilhar do esp&iacute;rito competitivo e mandar para dentro do est&ocirc;mago \"a alma em forma l&iacute;quida\" (nome atribu&iacute;do a Red Bull depois de uma longa e desgastante actividade f&iacute;sica).<br /><br />Na foto &eacute; um atleta Sul Africano que foi convidado para competir, no qual ele saiu em primeiro lugar na primeira manga. Atr&aacute;s dele vinha um atleta angolano e logo a seguir estava o ic&oacute;nico Z&eacute; Ponta.<br />Ap&oacute;s o t&eacute;rmino da primeira manga, vimos o Sul Africano isolado na lideran&ccedil;a. O madje cometia poucos erros e quase que n&atilde;o tinha fraquezas naquela pista. Logo, s&oacute; nos restava ver a luta pelo resto do p&oacute;dio sendo disputado pelo nossos angolanos, dentre eles o Z&eacute; Ponta e o outro atleta que por acaso fez algum do seu treinamento na di&aacute;spora. </p>\r\n<p>Antes de entrar para a segunda manga, todos os outros atletas j&aacute; estavam fora das suas respectivas Box (local onde eles repousam), excepto o Sul Africano e o Z&eacute; Ponta - as duas maiores ref&ecirc;rencias do evento. O Sul Africano, tendo reparado se estava tudo em conformidade e em prontid&atilde;o para sair, decidiu olhar pela &uacute;ltima vez para a Box onde estava o seu principal concorrente... o Z&eacute; Ponta.</p>','v1549106923/rtandrew-site/fotos/Motocross/IMG_3910.jpg','o-olhar-da-concorrencia',1,88,'2019-04-12 01:20:47','2022-11-28 13:34:19'),(71,'Campo dos Perdidos','<p>Na minha primeira expedi&ccedil;&atilde;o nos bairros Bita sofri bastante com o sol ardente e o calor que l&aacute; fazia.<br />Os trilhos de l&aacute; s&atilde;o reminiscentes dos guetos da cidade. Num momento est&aacute;s a andar bem, no outro v&ecirc;s-te dentro dum quintal alheio porque &eacute; o caminho para se chegar do outro lado. N&atilde;o obstante numa dessas situa&ccedil;&otilde;es ter c&atilde;es a ladrarem para mim, e outros, os mais rabugentos, a correrem bem atr&aacute;s da minha roda.<br /><br />Embora os trilhos me proporcinarem um monte de alegria, chegou uma altura que n&atilde;o consegui suportar mais aquele calor. E para falar a verdade, os suplementos haviam terminado e a &aacute;gua completamente quente. E, claro, sem omitir o facto de que parecia que andava &agrave; deriva...<br />Sendo assim, olhei para o GPS de formas a tentar me colocar na via principal para iniciar o meu regresso &agrave; casa. Uma vez mais, coloquei-me dentro de um quintal alheio, e para o meu azar desta vez n&atilde;o havia sa&iacute;da. O GPS dizia para continuar, mas a parede me impedia. <strong><em>PUDERA</em></strong>.<br />Olhei para senhora (provavelmente residente daquele local) que olhava-me vez em quando enquanto estendia a roupa, indagando o que um gajo de col&atilde;s e de bicicletas fazia no seu quintal. Matei o embara&ccedil;o e perguntei-lhe como era poss&iacute;vel voltar para o Kilamba, e ela disse que tinha de retornar e de seguida apontou para um local vasto qualquer que eu pr&oacute;prio n&atilde;o entendi. N&atilde;o liguei muito, at&eacute; porque tinha mesmo o GPS, e bazei.<br /><br />J&aacute; no trajecto correcto, notei um campo de futebol vasto. T&atilde;o vasto que se encontrava vazio. N&atilde;o maiei, encostei a bike, olhei ao redor e comecei a fotar. N&atilde;o demorou muito at&eacute; os putos come&ccedil;arem a se reunir a minha volta.</p>\r\n<p style=\"padding-left: 30px;\"><em>- Minha mota.</em><br /><em>- Hummm. &Eacute;h mbora minha. Eu vi primeiro.</em></p>\r\n<p>Pus-me a rir um bocado enquanto os via a discutir se a \"mota\" pertencia a quem...lol</p>\r\n<p style=\"padding-left: 30px;\"><em>- Papoite, t&aacute;s sair correr n&ecirc;?</em><br /><em>- Yha, t&oacute; sair correr. Estou fobado - disse eu sem esconder um sorriso do semblante. E assim meti-me novamente a pedalar, sem ao menos perguntar o nome do campo...</em></p>','v1547047794/rtandrew-site/fotos/BroTT/campo-dos-perdidos.jpg','campo-dos-perdidos',0,81,'2019-06-26 03:40:00','2022-11-29 08:44:22'),(81,'Beauty Queens','<p>Neste dia estava a decorrer o Open Day na universidade, um evento tecnol&oacute;gico onde indiv&iacute;duos, start-ups, e empresas exp&otilde;e os seus projectos e productos. Fizeram-se presentes o Luis (o meu Idris Elba), a Goureth (a Poltergeist), a Leid (Cocoa Butter Baby), e, sem esquecer da minha equipe t&eacute;cnica, o Miguel (Migos) e a Ivone. ?<br /><br />Tipo nada estavamos num granda mood, a fazer gra&ccedil;a do qu&atilde;o aborrecido aquilo estava a ser, a falar de besteiras, da actualidade e tudo mais. <br />De repente, com o incentivo do Lu&iacute;s (pudera!) a ser fotado pelo Miguel, bateu-me a criatividade de tamb&eacute;m fazer uns clicks. At&eacute; porque notei que a Leid e a Goureth possuem uma conex&atilde;o bu&eacute; forte e extrovertida, e isto contagiou-me de certa forma.<br /><br />Comecei primeiro com a Goureth. Ela estava nos seus dias \"a la urban outfitter gal\", bem &agrave; vontade com a skinny-jeans, um top branco, e um chap&eacute;u da O.V.O. Tirei algumas fotos para capturar a simetria que o combo da roupa+altura estavam a causar em contraste com o banco de concreto que l&aacute; se encontrava.<br />Depois, pedi que a Leid entrasse na cena para poder fotar as duas. Elas estavam bem avontad&iacute;ssimas e faziam at&eacute; gra&ccedil;as. Shots daqui, shots dali, at&eacute; que a Leid sugiriu que mud&aacute;ssemos de posi&ccedil;&atilde;o para que as fotos tivessem uma melhor exposi&ccedil;&atilde;o.</p>\r\n<blockquote>\r\n<p>&Agrave;s vezes ao fotar ficamos cegos e focados demais que esquecemo-nos de alguns detalhes que podem fazer toda a diferen&ccedil;a.</p>\r\n</blockquote>\r\n<p>Em suma, foi bu&eacute; divertido fazer fotos com estas donzelas super carinhosas e extremamente extrovertidas.</p>','v1562442610/rtandrew-site/fotos/beauty-queens.jpg','beauty-queens',1,130,'2019-07-07 18:21:00','2022-10-23 03:44:02'),(91,'Contrast Of A Sin City','<p>Essa &aacute;rea do Rocha j&aacute; testemunhou mulheres a se tornarem vi&uacute;vas e filhos a se tornarem &oacute;rf&atilde;os.</p>\r\n<p>Se Deus vivesse no Rocha, seria ele vendedor ambulante ou roboteiro*? <br />Preferiria ele lavar carros ou estar na ponte a gerir pequenos assaltos? <br />Quem sabe seria apenas fruto do bairro, &oacute;rf&atilde;o da Justi&ccedil;a Social, pronto pra sacar da cintura e ripostar a injusti&ccedil;a ao ver que a sua irm&atilde;, desarmada, foi assassinada com um tiro &agrave; queima-roupa &agrave; beira a da estrada, enquanto lutava por mais um dia para p&ocirc;r dinheiro e comida em casa.<br />Seria ele capaz?! Seria ele capaz de viver com tamanha atrocidade entalado na sua garganta e nunca manifestar para o resto da sua vida?<br />E tu, internauta, o benevolente Juiz, serias capaz de conden&aacute;-lo? Mandar-lhe para a pris&atilde;o quando o que ele mais necessitava era amor e sobretudo educa&ccedil;&atilde;o?</p>\r\n<p>Na Cidade do Pecado, dilema nunca faltou entre correr ou ser esfaqueado, entregar a carteira ou ser baleado, sacrificar-se ou morrer fobado.<br />&Eacute; preciso prud&ecirc;ncia, uma dose de ora&ccedil;&atilde;o e um pouco de sorte... para n&atilde;o ser apanhado na contra marcha do pecado.</p>\r\n<p>? Empty, Cold, Sadness and Darkness...A City Within a City ?</p>','v1562526974/rtandrew-site/fotos/Insolitus/contrast-of-a-sin-city.jpg','contrast-of-a-sin-city',1,88,'2019-07-07 19:19:00','2022-10-23 03:29:20'),(101,'As Cores da Coreia PT.1','<p>As Cores da Coreia foi na verdade sequencias de sunsets capturados na Nova Marginal, antiga Chicala.</p>','v1550636362/rtandrew-site/fotos/Le%20Paradox/le-paradox_1.jpg','as-cores-da-coreia-pt-1',1,93,'2019-10-21 02:42:00','2022-11-30 14:55:19'),(111,'Salinas da Samba','<p>Empreendimentos, edif&iacute;cios e formas de lazeres s&atilde;o erguidos &agrave; beira-mar de formas a proporcionar uma experi&ecirc;ncia de mil paladares sensoriais. <br />Enquanto isto, costumo a me gabar de que &eacute; no gueto, bem longe da cidade, longe de toda polui&ccedil;&atilde;o luminosa, que a vista para a c&eacute;u se torna deslumbrante.</p>\r\n<p>A brisa do mar me toca nos p&eacute;s e o sabor de sal navega em meus l&aacute;bios ressecados como de um marujo altamente viajado, enquanto assisto o dia me despedindo com o &uacute;ltimo feixe de luz do anoitecer, e a lua anunciando a vinda de um noite fresca e cheia de prazer.</p>\r\n<blockquote>\r\n<p><br />The night is dark and full of terrors... only to those in bad company.<br /><br /></p>\r\n</blockquote>','v1576202332/rtandrew-site/fotos/Le%20Paradox/salinas-da-samba.jpg','salinas-da-samba',0,69,'2019-12-13 02:05:00','2022-11-29 20:07:41'),(121,'It\'s a Leak Pt.2','<div data-pm-slice=\"1 1 []\" data-en-clipboard=\"true\">Uma das coisas que mais me agrada fazer com a c&acirc;mera &eacute; o Street Photography. Para mim, Street Photography &eacute; um estilo urbano bastante espont&acirc;neo, em que o fot&oacute;grafo tem de encontrar uma beleza dentre todo o caos, algo que chama a aten&ccedil;&atilde;o, cutuca ou desrespeita de certa forma uma forma de pensamento.</div>\r\n<div>&nbsp;</div>\r\n<div>Desde pessoas arrojadas at&eacute; as mais simples e carentes, monumentos, obras arquiectect&oacute;nicas modernas at&eacute; aquelas em degrada&ccedil;&atilde;o, acontecimentos de uma vida... hist&oacute;rias que merecem ser capturadas e revividas. &Eacute; por isto que eu adoro Street Photography:</div>\r\n<div>&nbsp;</div>\r\n<blockquote>\r\n<div>&Eacute; estar perante a uma efermidade e ainda assim tentar captur&aacute;-la.</div>\r\n<div>&Eacute; o tiro no escuro, com as chances de sucesso de 1 em 1 milh&atilde;o.</div>\r\n</blockquote>','v1547049461/rtandrew-site/fotos/Insolitus/its-a-leak-pt-2.jpg','its-a-leak-pt-2',0,89,'2020-01-07 12:09:54','2022-11-29 05:09:38'),(131,'The Sister Towers','<p>Ao descer <em>As Luzes </em>- tal como os mais jovens gostam de o chamar - observa-se do lado direito o panorama dos edif&iacute;cios da parte mais baixa da cidade e o resplendor mar que delimita a Bah&iacute;a de Luanda. Do lado esquerdo observa-se o <em>Sky Center</em> e a <em>The Sister Towers </em>- tal como eu pr&oacute;prio apelidei; conhecido tamb&eacute;m como Three Towers, um projecto inicializado pela Sonangol - tr&ecirc;s edif&iacute;cios que espantam os olhos qualquer um pela sua arquitectura moderna e, sobretudo, pela sua localiza&ccedil;&atilde;o.</p>\r\n<p>Dentre toda a beleza arquitect&ocirc;nica residente no Eixo Vi&aacute;rio, o que mais entristece &eacute; a falta arboriza&ccedil;&atilde;o naquele lugar (uma tend&ecirc;ncia <em>\"normal\"&nbsp; </em>em Luanda). N&atilde;o obstante, a escurid&atilde;o total e os assaltos frequentes afugentam qualquer um que queira passear tranquilamente e desfrutar da paisagem.</p>\r\n<blockquote>\r\n<p>&ldquo;Se calhar, depois das obras v&atilde;o reconstruir todo o jardim e a zona verde do Eixo. Esperamos que vejam isso. Ia ficar deselegante haver edif&iacute;cios modernos novos e uma &aacute;rea, antes verde, quase seca.&rdquo;, disse um morador ao <a title=\"Grandes Torres\" href=\"http://jornaldeangola.sapo.ao/reportagem/grandes_torres_no_eixo_viario\" target=\"_blank\" rel=\"noopener\">Jornal de Angola</a></p>\r\n</blockquote>\r\n<p>E foi exactamente o que aconteceu. O que estava para ser um local atractivo com um fluxo alto de neg&oacute;cios e pessoas, acabou por se tornar apenas a primeira op&ccedil;&atilde;o. O Eixo Vi&aacute;rio n&atilde;o &eacute; um local para qualquer um, muito menos para qualquer hora. Visitam os mais intr&eacute;pidos, os que j&aacute; conhecem e os nativos.</p>\r\n<p>&nbsp;</p>','v1579096714/rtandrew-site/fotos/Insolitus/the-sister-towers.jpg','the-sister-towers',1,83,'2020-01-15 14:58:00','2022-10-23 04:10:08');
