INSERT INTO `notas` VALUES (1,'... quem ela era... quem ela foi...','<p>Decidi fazer esta nota quando descobri que passava mais tempo a escrever sobre uma paix&atilde;o perdida...<br />E meio que apanhei jeito em escrever sobre outras mulheres tamb&eacute;m. :)</p>','background: #ee9ca7; background: -webkit-linear-gradient(to right, #ffdde1, #ee9ca7); background: linear-gradient(to right, #ffdde1, #ee9ca7);','#ee9ca7','quem-ela-era-quem-ela-foi',NULL,'2019-02-12 09:46:08'),(2,'Poesia Suja','<p>Onde a intensidade dita o ritmo da sensualidade,</p>','background: #FF416C;  /* fallback for old browsers */\r\n	background: -webkit-linear-gradient(to right, #FF4B2B, #FF416C);  /* Chrome 10-25, Safari 5.1-6 */\r\n	background: linear-gradient(to right, #FF4B2B, #FF416C); /* W3C, IE 10+/ Edge, Firefox 16+, Chrome 26+, Opera 12+, Safari 7+ */','#FF416C','poesia-suja',NULL,'2019-02-12 09:55:18'),(3,'O que o tempo nunca disse','','background: #a8ff78;  /* fallback for old browsers */\nbackground: -webkit-linear-gradient(to right, #78ffd6, #a8ff78);  /* Chrome 10-25, Safari 5.1-6 */\nbackground: linear-gradient(to right, #78ffd6, #a8ff78); /* W3C, IE 10+/ Edge, Firefox 16+, Chrome 26+, Opera 12+, Safari 7+ */','#a8ff78','o-que-o-tempo-nunca-disse ',NULL,NULL),(4,'Uma Espécie de Autobiografia','<p>Textos que de certa forma acarretam um pouco ou muito de mim, as minhas opini&otilde;es, e sobre a minha vida pessoal .</p>','background: #bdc3c7;  /* fallback for old browsers */ background: -webkit-linear-gradient(to right, #2c3e50, #bdc3c7);  /* Chrome 10-25, Safari 5.1-6 */ background: linear-gradient(to right, #2c3e50, #bdc3c7); /* W3C, IE 10+/ Edge, Firefox 16+, Chrome 26+, Opera 12+, Safari 7+ */','#bdc3c7','uma-especie-de-autobiografia','2019-02-01 22:07:49','2019-02-01 22:07:49');
