INSERT INTO `textos` VALUES (1,'The Moon Behind The Grey Clouds','<p>Her life it\'s like the vast sky full of clouds in the night\'s eve.<br />There is no stars, there is no shine.<br />There is nothing beautiful in it.<br />Only the fresh winds along with sad memories. So do I when I look at her.<br />I see nothing but her pale face like a moon hidden behind grey clouds.<br />Shy of its own beauty.<br />Scared with the scars she was blessed with<br />My sweet darling. Your life is like the sky full of clouds in the night\'s eve. You, the moon, decide if you keep glowing or not.<br />Doesn\'t matter what you do, or what you feel. Let the spectrum of your lights reflect in the water.<br />You shall set free the lights present in the holes of your body.<br />You shall ignore the ones that do not appreciate you the way I do<br />Because, in the darkest nights I will not lose my mind, nor I will lose you...<br />Just keep the lights of your holes on.<br />In case if I get lost in the water that your spectrum reflects on.<br /><br /></p>','the-moon-behind-the-grey-clouds',0,101,'2019-02-01 03:00:00','2022-10-25 21:53:15',NULL),(2,'Oásis','<p>Adoro quando nos encontramos ao acaso<br />quando sentimos a presen&ccedil;a um e do outro na encruzilhada de olhares<br />e nos cumprimentamos levantando a m&atilde;o fazendo um \"Ol&aacute;\"<br />Perguntamos o estado um do outro com os mesmos olhares,<br />acenando a cabe&ccedil;a para as laterais<br />dizendo \"Mais ou Menos, E que n&atilde;o consigo ficar sem ti por perto\"<br />[...]<br />E assim as nossas conversas v&atilde;o fluindo...com ligeiros sorrisos<br />At&eacute; nos aproximarmos, e trocarmos um longo e forte abra&ccedil;o<br />Dar-te um beijo na testa e sentir cheiro dos teus cachos<br />Destarte, perceber que o meu mundo orbita no teu o&aacute;sis.</p>','oasis',0,117,'2019-02-03 23:00:00','2022-10-25 12:41:29',NULL),(3,'Words I fail to say, But my heart yells them','<p>There are things we never forget<br />Like a hug<br />The very first kiss<br />The body in the bedsheet<br />Like labyrinth, knowing<br />Every corner of it<br /><br />There are things meant to be unforgettable<br />Like the face of our childhood love<br />Her doll face in a mermaid body<br />The female innocence<br /><br />There are things that are never enough to be said...<br />Like \"I love you\"<br />\"I miss you\"<br />\"I wish you could be here\"<br /><br />I am a poet<br />But these are the words that pains me the most to say<br />And<br />There are words like \"I\'m sorry\"<br />Words like these that my heart yells<br />Everytime<br />Everyday<br />That it should be years now<br />Without stopping...</p>','words-i-fail-to-say-but-my-heart-yells-them',1,91,'2019-01-01 23:00:00','2022-11-28 15:17:58',NULL),(4,'Um Desabafo Académico','<p>Em v&eacute;spera de projectos e defesas, pessoas lindas e formosas, irrita-me quando algu&eacute;m me pergunta se n&atilde;o irei defender. E caso responder que sim, h&atilde;o de perguntar o porqu&ecirc; de estar vestido de tal forma. <br />&Eacute; uma pergunta n&atilde;o obstante curiosa, mas no entanto rid&iacute;cula. E a&iacute; me pergunto:<br />\"O que ser&aacute; o mais importante? A minha vestimenta ou o meu trabalho? Aquilo que carrego no corpo ou na cabe&ccedil;a?\" <br />De qualquer forma, de nada me adianta pensar na vestimenta que irei de usar, se n&atilde;o consigo fazer o meu programa compilar. <br />&Eacute; t&atilde;o simples assim porra! </p>','um-desabafo-academico',1,95,'2018-12-31 23:00:00','2022-11-30 10:14:09',NULL),(5,'Cabernet Sauvignon','<div>Degustar &eacute; ter a tua boca como decanter</div>\r\n<div>E ter o Sommelier em minha mer&ccedil;&ecirc;</div>\r\n<div>Deixar aromas serem libertados que nem combust&atilde;o</div>\r\n<div>Sabores picantes que nem comich&atilde;o</div>\r\n<div>Em cada beijo, em cada degusta&ccedil;&atilde;o</div>\r\n<div>O teor alco&oacute;lico &eacute; a suculenta saliva</div>\r\n<div>Pertinentes dessas almas desconhecidas</div>\r\n<div>O dialecto &eacute; o contacto das linguas</div>\r\n<div>E s&atilde;o os nossos gestos, a intensidade do calor</div>\r\n<div>Que ditam a textura e a cor</div>\r\n<div>Do nosso t&atilde;o amado Cabernet Sauvignon.</div>','carbenet-sauvignon',1,104,'2019-01-02 23:00:00','2022-11-29 15:04:52',NULL),(6,'Bilhete de Passagem','<p>Uns viajam para esquecer, eu viajo para recordar<br />Quer das tristezas, quer das felicidades<br />Para espairecer, me achar<br />Tanto das viv&ecirc;ncias, quer das afinidades<br /><br />Diga-se de passagem que o futuro actual &eacute; a miragem do passado<br />Por isso, escolho diariamente viajar na reminisc&ecirc;ncia do nosso amor<br />E como pre&ccedil;o tenho vislumbres das tempestades e turbul&ecirc;ncias<br />Rezando que os ventos tragam nos seus sopros o teu odor<br />Para que, pela &uacute;ltima vez, possa me confortar nas recorda&ccedil;&otilde;es,<br />aquando sent&aacute;vamos no p&aacute;tio<br />Falando por horas afinco<br />Eu e as minhas anedotas<br />Tu e os teus sorrisos<br />Dois rostos cheios de vincos<br /><br />&Eacute; tamb&eacute;m adormecer nos sopros dos ventos<br />E lembrar daquilo tudo que nos aconteceu <br />Dos abra&ccedil;os que n&atilde;o demos, das discuss&otilde;es que tivemos<br />O que somos agora &eacute; o fruto de um adeus mal dado<br />De um amor mal retornado<br />E inclusive do apego for&ccedil;ado<br /><br /><strong>Bilhete de Passagem</strong> <sup>(def.)</sup><br />&eacute; quando deixo o presente para embarcar nas tuas hist&oacute;rias<br />Descal&ccedil;o, correndo por ti, entre as nebulosas trilhas<br />Na falta de guia, vou seguindo o rel&oacute;gio sem me preocupar com as horas<br />Falando sobre planos, at&eacute; que se fa&ccedil;a chover utopias.</p>','bilhete-de-passagem',1,121,'2019-02-01 03:00:00','2022-10-25 09:02:10',NULL),(7,'Amor sem destinatário','<p>&Eacute; o caso dos acasos<br />Do destino mal destinado<br />Sem remetente, sem destinat&aacute;rio<br />O amor mal premeditado que vive no a&ccedil;&uacute;car amargurado<br /><br />S&atilde;o tantos encantos,<br />Que no entanto<br />A gente deixa por a&iacute;...num canto<br />E quando algu&eacute;m o encontrar<br />A gente vai tentar lhe reivindicar atrav&eacute;s de prantos...<br /><br />H&aacute; tanta coisa absurda<br />Mas ainda assim o mundo nos julga<br />Pela pessoa que a gente se debru&ccedil;a<br />E escolhe em ser o seu pintor:<br />Pegar nos seus defeitos e torn&aacute;-los em algo maior...<br /><br />Amor vem, amor vai<br />Somos frutos do acaso<br />Nascidos sem m&atilde;e sem pai<br />Num mundo vulgar<br />Sem algu&eacute;m que nos possa educar o prop&oacute;sito de realmente amar!<br /><br /></p>','amor-sem-destinatario',1,127,'2019-01-31 23:00:00','2022-11-30 11:16:50',NULL),(8,'Souvenir de uma Saudade','<p>&Agrave;s vezes, para matar as saudades, coloco uma das almofadas no peito e fico a imaginar voc&ecirc; adormecida nele<br />Fico preso a acompanhar o teu lento respirar<br />Caindo em vertigens ao apreciar os teus cabelos a deslizarem entre os meus dedos como se fossem areia do mar<br />Desmaio em sonhos quando o meu cora&ccedil;&atilde;o escuta os teus batimentos card&iacute;acos<br />Decifrando meticulosamente a varia&ccedil;&atilde;o de bombeio em cada teu sentimento perdido<br /><br />Sinto falta de te ver a brincar no chuveiro<br />Vendo a &aacute;gua a deslizar pelo teu corpo inteiro<br />Saindo das montanhas dos teus seios<br />at&eacute; perder a altitude nas cascatas das tuas pernas<br />Desaguando na Foz do Banheiro<br /><br />As viagens n&atilde;o param at&eacute; que eu tamb&eacute;m caia no sono.<br />E quando acontecer, ainda estaremos juntos, pertinhos e aconchegados<br />Deitados nesta mesma min&uacute;scula cama, com len&ccedil;&oacute;is brancos amarrotados<br />Os nossos p&eacute;s, que nem estrelas, juntinhos e entrela&ccedil;ados<br />E eu a fazer cafun&eacute; nesses teus pequeninos l&aacute;bios... <br /><br /><em><strong>\"Souvenir &eacute; sentir o teu perfume nestas fronhas quando tu j&aacute; n&atilde;o est&aacute;s por perto\"</strong></em></p>','souvenir-de-uma-saudade',1,88,'2019-01-16 23:00:00','2022-10-22 21:51:03',NULL),(9,'Literatura do Amor','<p>Meu amor agora vive nas tintas<br />Entre linhas<br />Mudando sempre de linha<br />At&eacute; virar p&aacute;ginas<br />Escrevendo sobre desgra&ccedil;as<br /><strong>Ponto!</strong><br />Agora passa essa linha<br />Para costurar o peito rasgado<br /><strong>V&iacute;rgula!</strong><br />Para descansar e respirar fundo<br />Espregui&ccedil;ar a mente pra escrever novos conte&uacute;dos<br />Contudo...<br /><strong>Ponto e v&iacute;rgula!</strong><br />&Eacute; dessa que um novo amor entra na minha vida<br />Para me dar belos motivos para escrever belas poesias<br />Retic&ecirc;ncias!<br />A parte em que ultrapassamos a paix&atilde;o<br />E enxergamos a clareza do cora&ccedil;&atilde;o<br /><strong>Etc...</strong><br />J&aacute; se conhece a hist&oacute;ria de cor<br />Vou pulando mais um capitulo mal escrito<br />nas p&aacute;ginas do mesmo livro<br />Resili&ecirc;ncia!<br />Prontos! Quem nunca?!<br />Nesse oceano navego, ou melhor, sou arrastado<br />Dentro de uma garrafa totalmente b&ecirc;bado<br />Rezando que as tempestades se acalmem<br />E que as ondas, com a ajuda dos ventos,<br />Me devolvam ela nos meus pensamentos..</p>\r\n<p><br />Poha, fudeu. Me lembrei dela...<br /><strong>Erro!!!</strong><br />O pior &eacute; que amor fracassado n&atilde;o leva corrector.<br /><br />Redator, bota a&iacute; um ponto de <strong>exclama&ccedil;&atilde;o!</strong><br /><br />Preciso de um caderno novo...</p>','literatura-do-amor',1,90,'2019-01-24 23:00:00','2022-10-24 11:29:11',NULL),(10,'Confissão de uma Saudade','<p>Guardei o teu beijo, o teu abra&ccedil;o...<br />Confesso!<br />Guardei os teus serm&otilde;es, a tua grossura...<br />Amei-os, confesso!<br />Guardei os teus gemidos, e as marcas das tuas unhas...<br />Confesso!<br />Guardei&nbsp; o teu cheiro pela casa e a tua bagun&ccedil;a...<br />Ainda c&aacute; est&atilde;o, confesso!<br />Guardei e ainda alimento o teu gato...<br />Meu companheiro, confesso!<br />Guardei as tuas desculpas, e a tua inoc&ecirc;ncia...<br />Guardei e costumo a ver os nossos Snaps, Stories, fotos e v&iacute;deos<br />Guardei as tuas cuecas, calcinhas, soutiens<br />Guardei as chinelas, as jeans, as camisas da Burberry<br />As pulseiras, rel&oacute;gios, brincos e fios de ouro<br />Guardei tudo o que pude de ti!<br />Se sinto saudades tuas? Sim, confesso!<br />Confesso tudo e mais pouco.<br />Confesso que ainda durmo no nosso quarto, despido e aposentado em mem&oacute;rias e cheiros<br />As imagens aparecem nitidamente tal como se ainda estivesses aqui...em vida<br />&Agrave;s vezes o gato mal consegue comer, sair de casa e percorrer umas milhas, tal como fazia contigo<br />Ali&aacute;s, todos n&oacute;s sentimos a tua falta. Eu, o gato, a casa, as flores, e o filho que nunca tivemos<br />Eu entendo a tua partida<br />Mas o vazio que deixaste &eacute; indubit&aacute;vel<br />Pois ele ainda est&aacute; fresco e apalp&aacute;vel...</p>','confissao-de-uma-saudade',1,143,'2019-02-01 01:55:00','2022-11-29 20:45:38',NULL),(12,'A Rosa e os seus Espinhos','<p><strong>Constela&ccedil;&atilde;o<sup> (def.)</sup></strong>&nbsp; &eacute; conjunto de estrelas<br />Formado pelos espinhos do teu rosto. <br />Uns mais pequenos, outros mais grossos<br />Alguns cintilantes e extravagantes, outros envergonhados e t&iacute;midos<br />Uns mais pr&oacute;ximos, outros mais afastados<br />Alguns agressivos e rev&uacute;s, outros amenos e de baixo temperamento<br />Cada um distinto na sua complexidade natural. Aquele que n&atilde;o sabe o valor deles<br />jamais compreender&aacute; o valor da tua beleza, e por conseguinte o do teu amor.<br /><br />- Assim disse o Beija-Flor &agrave; Flor, que chorava incessantemente ao se deparar no espelho preparando-se para colocar a maquiagem.<br /><br />Como j&aacute; previa o Beija-Flor, a pobrezinha teve o plano arruinado pelas l&aacute;grimas que deixaram o seu rosto numa completa l&aacute;stima.<br />Entretanto, o Beija-Flor segurou no bra&ccedil;o da cadeira e girou (360&deg;) para frente do espelho. Puxou-lhe o cabelo para tr&aacute;s, de seguida pousou-lhe as m&atilde;os pelos ombros, inclinou-se no lado direito da pobrezinha e quando os seus olhares fixaram-se atrav&eacute;s da reflex&atilde;o do espelho ele disse-lhe de forma r&iacute;tmica e confiante:<br /><br />\"Teus olhos refletem o mar de l&aacute;grimas que em ti est&atilde;o aprisionadas<br />&agrave; espera que se fa&ccedil;am tempestades de choros para libertar a alma constipada<br />Transborda-te mulher!<br />Chorar n&atilde;o faz mal a ningu&eacute;m<br />N&atilde;o ser&aacute;s a primeira e t&atilde;o pouco a &uacute;ltima a sentir a l&acirc;mina desta depress&atilde;o inef&aacute;vel<br />Queres falar sobre isso? N&atilde;o consegues? No worries. <br />Serei a tua almofada companheira para enxugar as l&aacute;grimas e aliviar o luto<br />E se n&atilde;o passar agora, criamos um plano juntos para vencermos as probabilidades do futuro.\"</p>','a-rosa-e-os-seus-espinhos',1,152,'2019-02-04 01:25:00','2022-11-30 07:41:43',NULL),(21,'À Deriva','<p>Tentei viajar pelo pa&iacute;s afora<br />Conhecer faces novas<br />Sentei-me com monges<br />Tribos<br />Estudei sobre religi&atilde;o<br />E fiz do meu corpo um canal espiritual<br />Escalei montanhas e diversas paisagens<br />Aventurei-me em corpos estrangeiros sem bilhetes de passagem<br />Mas nunca<br />Nunca mesmo<br />Me senti t&atilde;o perdido<br />Tal como fiquei quando vi o meu reflexo<br />Nos teus olhos<br />&agrave; deriva nos devaneios da vida<br />Tentando preencher a saudade idealizada<br />Nos cantos mais tristes da vida<br />Com viagens marcadas s&oacute; de ida...</p>','a-deriva',0,130,'2019-03-01 16:16:45','2022-11-29 12:14:08',NULL),(31,'On-line','<p>De manh&atilde;, o rel&oacute;gio marca 7hr<br />A luz matinal vai entrando, <br />escapando pelo buraco da janela<br />coberto por cortinas semiabertas<br /><br />Cama desarrumada, len&ccedil;ois amarrotados<br />Somos cumprimentados pela luz fraca<br />que aterra sobre os nossos corpos <br />maculados, despidos como anjos<br /><br />Que corpo &eacute; este, t&atilde;o terno e af&aacute;vel, que jaz sobre o meu?<br />Que alma febril &eacute; esta, que me faz companhia nesta cama t&atilde;o gelada como o c&eacute;u?<br /><br />Receio de acord&aacute;-la, mas por outro lado anseio por conhec&ecirc;-la<br />Anseio por saber como chegou nesta cama, <br />e como durante a noite <br />ousou despir a minha solit&aacute;ria alma<br /><br />Enfim<br />A calma j&aacute; n&atilde;o reside em mim, <br />Ch&aacute; de camomila para me acalmar, <br />pois peito ainda sente a repercuss&atilde;o daquele beijo<br /><br />O cora&ccedil;&atilde;o ainda sente as vertigens <br />causadas pela lubricidade daqueles l&aacute;bios, <br />ros&aacute;ceos, carnudos <br />softs como manteiga derretida no canudo<br /><br />Os nossos l&aacute;bios,<br />como navios em alto mar <br />sem b&uacute;ssola sem vento<br />embateram-se um ao outro <br /><br />As l&iacute;nguas &agrave; deriva em todas as partes do corpo,<br />apreciando cada onda, cada mergulho <br />at&eacute; cair nas profundidades <br />das nossas profanas concavidades<br />Onde instigamos os gostos, odores e orgulhos<br />at&eacute; nos afundarmos no orgasmo m&uacute;tuo<br /><br />Ai...<br />Quem &eacute;?<br />Mas quem &eacute;?<br />Ser&aacute; que algum dia te vou voltar a ver?<br /><br />Penso nestas quest&otilde;es todos os dias, todas as noites <br />Esperando pelo momento em que entras on-line e possas me dizer novamente o teu nome...</p>','on-line',1,139,'2019-03-10 12:24:24','2022-10-25 09:02:13',NULL),(41,'Rum & Cola','<p>Cigarro na m&atilde;o<br />Amor nos olhos<br />As horas passam<br />E j&aacute; sinto as saudades<br />A correrem pelo corpo<br /><br />Liberto o rancor em formas de fumo<br />No copo &eacute; aonde a minha mente segue,<br />sem dire&ccedil;&atilde;o sem rumo<br /><br />Poderia fazer-me &agrave; estrada,<br />sem me importar com nada<br />Entrar numa casa de bordel,<br />deleitar-se no calor de corpos de aluguel<br /><br />[...] S&oacute; que n&atilde;o [...]<br />Sorte ou destino,<br />preferi tomar uma dose de Sauvignon<br />para salvar a paz interior<br />que por acaso ela j&aacute; terminou...<br /><br />Chefia!<br />Abarrote o meu copo de paz, por favor<br />Quero achar o meu ego e<br />segredar-lhe os meus pensamentos...<br />Sangue-sangue n&atilde;o se fatigam<br />Rum para me lembrar que sou valente<br />E Coca-Cola para me dizer que sou de sangue puro</p>','rum-and-cola',1,142,'2019-03-19 21:43:58','2022-11-29 16:01:06',NULL),(51,'Quem Somos Nós','<p><strong><strong>Gera&ccedil;&atilde;o Y - Millennials</strong><br /></strong>Somos hero&iacute;s desconhecidos,<br />sem capa, sem farda, e sem arma<br />Desempregados e sem precedentes,<br />vivendo do sabor de uma vida mal amada..<br /><br />Viv&iacute;amos sob o teto do governo portugu&ecirc;s<br />onde sentimos na pele a repress&atilde;o e a opress&atilde;o<br />35 anos mais tarde,<br />o governo &eacute; outro mas a escravatura &eacute; a mesma,<br />pois a luta agora &eacute; contra o peculato e a corrup&ccedil;&atilde;o.</p>\r\n<p><strong>Gera&ccedil;&atilde;o Z</strong><br />Somos jovens suicidas,<br />asfixiados pela demanda de expectativa<br />a dizer aos outros jovens que o suic&iacute;dio n&atilde;o &eacute; a solu&ccedil;&atilde;o.<br /><br />Somos fumantes, <br />Mas optamos pela palavra \"amante\" <br />O pulm&atilde;o e o cora&ccedil;&atilde;o, inocentes,<br />algemados numa nebula de fumo,<br />expelindo pela boca o odor do defunto<br />que aos poucos vai cavando o seu pr&oacute;prio t&uacute;mulo.<br /><br />Outrora ancestrais com catanas, hoje <br />filhos com l&aacute;pis e esferogr&aacute;fica<br />a caminho de tr&ecirc;s forma&ccedil;&otilde;es mal formadas <br />Luandando no final da tarde,<br />depois de sair da Baixa para o CV entregar,<br />bombom com ginguba &eacute; o nosso jantar.<br /><br /><strong>Gera&ccedil;&atilde;o Alpha</strong><br />Somos crian&ccedil;as desta na&ccedil;&atilde;o<br />desnutridos de sonhos,<br />magros, alimentados por um futuro intrigante<br />onde a esperan&ccedil;a a cada m&ecirc;s perece.<br /><br />Parece que temos escolha, mas n&atilde;o <br />&Eacute; tipo a democracia c&aacute; na banda,<br />uma mera ilus&atilde;o...<br /><br />Adolescente de 15 anos<br />prostitui-se para alimentar a fam&iacute;lia<br />O pai, indignado, deita fora a comida<br />A m&atilde;e faz prantos, e acusa a igreja de bruxaria<br />a irm&atilde;, carente e desnutrida, passa &agrave; fome<br />enquanto o irm&atilde;o ajuda com o que pode<br />fazendo assaltos na ponte.<br /><br /><strong>Quem somos n&oacute;s? Quem sou eu!?</strong><br />Para ser honesto,<br />e sem mencionar o resto,<br />n&atilde;o sei quem sou, por que eu luto <br />e nem t&atilde;o pouco para onde vou.<br /><br />Sinto nada, cansei-me de tudo<br />Sigo avante como manda o hino <br />buscando e abra&ccedil;ando o pouco<br />e do pouco que consigo<br />j&aacute; &eacute; o suficiente pra garantir um copo<br />ou quem sabe um corpo<br />At&eacute; porque lixado j&aacute; estou, <br />mas solit&aacute;rio &eacute; que n&atilde;o fico.<br /><br /><br /></p>','quem-somos-nos',0,135,'2019-05-04 01:27:00','2022-10-23 04:05:53',NULL),(61,'A Peace With The Past','<p>Something abrupt happened almost 2 years ago. In my many attempts to amend the situation, which I miserably have failed, I always felt guilty and a constant burden in my head. After all, it all happened because of me...well sort of.<br /><br />In the last month, May 2019 to be more precise, something outta usual happened. I was in a taxi, and right after I got out I heard a loud voice calling for my name. Time has passed and that voice was no longer familiar to my ears. So, without many expectations, I turned around and besides noticing only this person, there were also blurred faces of the crowd around us. And there she was. A little bit thinner, little to no makeup, a black eye line, a black dress, a long black African blazer, and a sleek bun. She looked like a doll albeit being one year older than me.<br /><br />It was shock and surprise at the same time. I walked towards her, gave a hug and instantaneously felicitated for her engagement (did I say she was engaged?!). Happily, she thanked for my vow of felicitation. In full ecstasy, she then grabbed my hand and said:<br /><br />- Where is the ring? Aren\'t you married?<br />- Nope. I am not. Too early to be, don\'t you think? Argh! Sorry. You just got engaged.<br />- Yeah! - She replied, raising her hands making a gesture with the fingers to show me the ring.<br />- What about your girlfriend?<br />- Don\'t have either.<br />- Why not?<br />- Perhaps I am not looking enough...<br />- Don\'t worry. God will provide. (did I tell she was dedicated to a religious life?!)</p>\r\n<p>So yeah, we kept talking as we were walking. Her engagement, my life, her fiance, my activities, her church, my studies...<br />Anyway, it happened against all the odds in the world, especially in one of the most unusual ways...The universe has a strange way to reveal itself - I thought.<br />I felt relieved when we, perhaps for the last time, extend our arms, and with an open heart along with a smile in our faces, we gave a long goodbye.<br />If we didn\'t find happiness in each other arms, then I am more than happy that there is an arm were she will find comfort and love.<br />After all, she was happy, which was exactly what I would have wished.<br /><br />P.S: Not everyone has the oportunity to make peace with the past. This situation has taught me that it ain\'t good to end a relationship with bad blood, because, let\'s be honest, you never know that the future holds. If you find yourself in the same feet, I urge you to atleast try and not be the person who thinks as below:</p>\r\n<blockquote>\r\n<p>If we ever be friends again then we never loved enough.</p>\r\n</blockquote>','a-peace-with-the-past',0,153,'2019-07-06 17:52:32','2022-10-25 09:02:06',NULL),(71,'Tudo Vale!','<p>Tudo vale!<br />Nesse jogo n&atilde;o h&aacute; batotas <br />Tua vit&oacute;ria &eacute; minha vit&oacute;ria<br />Destarte, n&atilde;o haver derrotas<br /><br />Tudo vale! <br />No tapete ou na cama <br />Na cozinha ou na sala<br />No quarto das crian&ccedil;as <br />ou mesmo na varanda<br /><br />Aonde quer que seja, <br />o importante mesmo &eacute; fazer <br />Mas que se fa&ccedil;a bem! <br />O que &eacute; mal feito causa arrependimentos<br />Ent&atilde;o fa&ccedil;amos, meu bem<br /><br />Tudo vale! <br />Pegar na peruca ou rasgar a camisa <br />Com ou sem camisinha <br />R&aacute;pido e forte <br />Ou gostoso e lento <br /><br />Tudo vale! <br />Desarrumar a casa ou quebrar a mob&iacute;lia <br />Deixar que os vizinhos chamem a policia<br />Em tempos de tr&eacute;guas ou intrigas<br />Temos de saber que haver&aacute; sempre car&iacute;cias<br /><br />Aonde quer que seja, <br />o importante mesmo &eacute; fazer<br />Mas que se fa&ccedil;a bem! <br />O que &eacute; mal feito, causa arrependimentos<br />Ent&atilde;o fa&ccedil;amos, meu bem<br /><br />At&eacute; porque,<br />nesse jogo vale tudo<br />S&oacute; n&atilde;o vale mesmo<br />&eacute; acordar as crian&ccedil;as.</p>','tudo-vale',0,136,'2019-08-16 00:59:27','2022-10-22 21:53:30',NULL),(81,'Luanda, sua prostituta!','<p>Coitada de Luanda, <br />onde o poder compra as suas curvas<br />com empreitadas<br />Estrangeiros seduzidos pelas suas noitadas <br /><br />Coitada de Luanda, <br />sem escolhas, ela troca tudo por kwanzas <br />Dando prioridade a quem mais paga<br />Oh, Luanda! <br />Mas que mulher precoce te tornaste! <br /><br />Antes, <br />uma linda beldade, <br />com um corpo esbelta<br />e seios pequenos <br />Hoje,<br />na falta de investimento&nbsp; <br />e a&nbsp;barriga cheia de pneus, <br />j&aacute; n&atilde;o &eacute;s o predilecto pit&eacute;u <br />Resultado do leite ter azedado<br />e o esperma ter adocicado <br />N&atilde;o passas de uma mulher<br />fora do padr&atilde;o americano <br />&agrave; busca do sustento&nbsp;europeu <br /><br />O tempo passou <br />Novinhas nasceram <br />Ent&atilde;o, maquias a tua beleza<br />com betumes e pedras<br />para agradar o branco <br />que sempre preferiu as magrelas<br />Tal como as estradas desabam, <br />assim cai o teu betume com chuvas de l&aacute;grimas <br /><br />Injectas a economia em tuas jardas<br />Declaras-te uma mulher independente<br />roubando terras dos outros<br />E para qu&ecirc;?! <br />Para ver os&nbsp;teus filhos &uacute;nicos a sofrer,<br />dentro de um acaba-de-me-matar*,<br />a morrerem por falta de ilumina&ccedil;&atilde;o<br />nos labirintos do Zenga<br /><br />E tu, sem vergonha na cara, <br />ousas, ainda assim, <br />exibir as tuas cirurgias pl&aacute;sticas<br />minimamente completadas, <br />injectando a economia em tuas jardas, <br />que&nbsp;de tanta m&aacute; ger&ecirc;ncia&nbsp;elas apodrecem <br />tal como o lixo e as &aacute;guas paradas<br /><br />O ocidente fode e chula os bar&otilde;es <br />Os bar&otilde;es, de tanto stress, fodem-te a ti<br />E tu, sem saber o que fazer, <br />chulas os empregados dos&nbsp;bar&otilde;es <br />E assim segue o jogo da foda<br />Cada um pega e passa<br />Tal como diz a anciente hist&oacute;ria... <br /><br />O poder te seduziu<br />A lux&uacute;ria te vestiu<br />O tempo ditou os problemas<br />O dinheiro reduziu<br />O lixo te extinguiu<br />Entretanto, <br />ainda tens a fama<br />de ser a mulher mais cara<br />para se levar na cama<br />E como pode?! Se h&aacute; rumores<br />dizendo que est&aacute;s acabada</p>\r\n<p>J&aacute; n&atilde;o d&aacute; para renovar as jardas <br />ou ter maquiagem betuminosas<br />e louboutin de var&otilde;es altos<br />E agora, agora que a banga acabou<br />e a tua cara inflamou,<br />tens a difama&ccedil;&atilde;o de uma prostituta<br />que serve a todos e agrada poucos<br /><br />Quando deres por ti, <br />estar&aacute;s outra vez gr&aacute;vida<br />E como quem&nbsp;da piada ri, <br />estaremos novamente <br />a bater a porta do FMI.</p>','luanda-sua-prostituta',1,210,'2019-08-16 01:04:00','2022-11-03 21:04:06','v1573951733/rtandrew-site/textos/posters/Luanda_Sua_Prostituta.png'),(91,'Devoradora de Livros','<p style=\"text-align: left;\"><em>Ela &eacute; cidad&atilde; do mundo,</em><br /><em>o seu passaporte s&atilde;o livros... </em><br /><em>Vermelhos, azuis,</em><br /><em>verdes, pretos,</em><br /><em>brancos ou amarelados.</em><br /><em>Alguns destes s&atilde;o novos,</em><br /><em>velhos, de bolso ou grandes.</em><br /><em>Certeza h&aacute;, que todos</em><br /><em>s&atilde;o diplom&aacute;ticos.</em></p>\r\n<p><em><br /></em>Apesar de gostar de caf&eacute;, o ch&aacute; verde sem a&ccedil;&uacute;car&nbsp;com um pitada de mel e lim&atilde;o, &eacute; a combina&ccedil;&atilde;o ideal para uma manh&atilde; de leitura. <br />Ela faz de conta que &eacute; uma rosa &agrave; merc&ecirc; dos ventos. Ora navegando entre o c&eacute;u e o mar, ora atravessando dunas e montanhas. De tanta imagina&ccedil;&atilde;o, ou ela adormece com o livro no outro lado da cama, ou n&atilde;o se apercebe da ch&aacute;vena quente que repousa sobre as folhas do livro, fazendo com que elas v&atilde;o ganhando &aacute;urea em forma de manchas.</p>\r\n<blockquote>\r\n<p><br />N&atilde;o h&aacute; necessidade de impor metas. Ela n&atilde;o deve ser for&ccedil;ada, idem. Quando a leitura &eacute; prazerosa, ela &eacute; naturalmente incentivadora. - dizia ela.</p>\r\n</blockquote>\r\n<p>Ela possui livros para tudo e inclusive para qualquer ocasi&atilde;o. Livros de cozinha, de empoderamento, eleva&ccedil;&atilde;o profissional, livros para se ler num s&aacute;bado de praia, no banheiro, livros de bolso para se ler no candongueiro... at&eacute; a B&iacute;blia ela lia.&nbsp;</p>\r\n<p>Certa vez ao andarmos pela rua, avistou v&aacute;rios livros estendidos no ch&atilde;o a serem vendidos por um senhor com um pouco mais de meia idade. Virou bruscamente de direc&ccedil;&atilde;o e quando l&aacute; chegou, p&ocirc;s-se a contemplar pelos t&iacute;tulos para ver se reconhecia pelo menos um.<br />- Aha! - exclamou ela depois de algum tempo perdida e indecisa a olhar para tantos livros. <br />- Passa-me aquele, senhor. - disse&nbsp;ansiosa.<br />Ao segurar o livro, notei que era bastante amarelado, a capa estava murcha e a ceder aos bocados...<br />- Quero este! - gritou apreensiva, sequer ter acabado de ler o pref&aacute;cio.<br />O senhor olhou para ela admirado pela sua energia. Ent&atilde;o os dois puseram-se a olhar para mim. O senhor a querer receber o dinheiro e ela a querer levar o livro para a casa.<br />- Quanto custa? - perguntei eu extremamente&nbsp;hesitante.<br />- 3000kz.<br />- N&atilde;o tenho o suficiente!<br />- Quanto tens?<br />- (olhei para a carteira) 2000kz... e com as moedas tenho (meti os dedos no bolso de moeda da jeans)... 2300kz.<br />- Eu tenho 1000kz.<br />- N&atilde;o &eacute; suposto ser para o t&aacute;xi?<br />- N&atilde;o faz mal.&nbsp;</p>\r\n<div data-pm-slice=\"1 1 []\" data-en-clipboard=\"true\">Tendo j&aacute; efectuado a compra, continuamos a descer pela Avenida Brasil. Uma vez mais, ela parou de repente. Abriu-o, deu um soprou e umas tapas. Revirou algumas p&aacute;ginas e de seguida encostou o livro no seu rosto e inspirou t&atilde;o profundo como se fosse analg&eacute;sico. De seguida, expirou lentamente apaixonada, como se contente estivesse pelo orgasmo causado.</div>\r\n<div data-pm-slice=\"1 1 []\" data-en-clipboard=\"true\">\r\n<div data-pm-slice=\"1 1 []\" data-en-clipboard=\"true\">&nbsp;</div>\r\n<div data-pm-slice=\"1 1 []\" data-en-clipboard=\"true\">E foi assim que aprendi algo interessado sobre ela. <em>Que quanto mais poeirentos e velhos fossem os livros, mais saborosos e nost&aacute;lgicos seriam os seus conte&uacute;dos</em>.&nbsp;</div>\r\n</div>\r\n<div data-pm-slice=\"1 1 []\" data-en-clipboard=\"true\">&nbsp;</div>','devoradora-de-livros',1,165,'2019-11-17 01:32:00','2022-11-28 07:28:48','v1573951707/rtandrew-site/textos/posters/Devoradora_de_Livros.png'),(101,'Estado da Nação','<div data-pm-slice=\"0 0 []\" data-en-clipboard=\"true\">Passos desaceleraram&nbsp;</div>\r\n<div>ao ver as machetes do \"O Pa&iacute;s\"</div>\r\n<div>Surpresa!</div>\r\n<div>Novo empr&eacute;stimo do FMI</div>\r\n<div>&nbsp;</div>\r\n<div>JLO humilha-se &agrave; China</div>\r\n<div>para tapar os buracos do pa&iacute;s&nbsp;</div>\r\n<div>Enquanto isso abafa o caso&nbsp;</div>\r\n<div>alegando&nbsp;que vai cortar o mal pela raiz</div>\r\n<div>&nbsp;</div>\r\n<div>Manos e manas a se espalharem&nbsp;</div>\r\n<div>Efeito do iPhone XI</div>\r\n<div>Fake News s&atilde;o vendidos rapidamente&nbsp;</div>\r\n<div>Wey Tommy e a Poca Py</div>\r\n<div>&nbsp;</div>\r\n<div>Mosquitos fazem manifesta&ccedil;&atilde;o</div>\r\n<div>nas vias principais das &aacute;guas paradas</div>\r\n<div>As mortes causadas pela jarda</div>\r\n<div>superam, pela primeira vez, a mal&aacute;ria</div>\r\n<div>&nbsp;</div>\r\n<div>Depois de&nbsp;Eva Rap Diva&nbsp;</div>\r\n<div>Gilmario &eacute; expulso do para&iacute;so&nbsp;</div>\r\n<div>A crise finalmente chegou no partido&nbsp;</div>\r\n<div>Mamas&nbsp;zungueiras j&aacute; n&atilde;o temem a pol&iacute;cia</div>\r\n<div>Agora batem de frente com IVAn</div>\r\n<div>subindo o pre&ccedil;o da mandioca, ginguba,&nbsp;</div>\r\n<div>at&eacute; do t&atilde;o amado p&atilde;o com isca</div>\r\n<div>&nbsp;</div>\r\n<div>Jejum de maratonas</div>\r\n<div>leva jovens a questionar</div>\r\n<div>as incompet&ecirc;ncias do MPLA</div>\r\n<div>Ser&aacute; que &eacute; desta que os&nbsp;marimbondos</div>\r\n<div>ser&atilde;o expulsos do lar?!</div>\r\n<div>Popula&ccedil;&atilde;o angolana fodida com JLO</div>\r\n<div>e o seu lema de governa&ccedil;&atilde;o</div>\r\n<div>\"Exonerar e Viajar\"</div>\r\n<div>&nbsp;</div>\r\n<div>Nomea&ccedil;&atilde;o de Adalberto J&uacute;nior</div>\r\n<div>mostra que UNITA</div>\r\n<div>n&atilde;o &eacute; apenas bom de contas</div>\r\n<div>mas tamb&eacute;m em democracia</div>\r\n<div>Totalmente oposto</div>\r\n<div>daquilo que a oposis&atilde;o dizia...</div>\r\n<div>&nbsp;</div>\r\n<div>O feminismo continua a colher os seus frutos</div>\r\n<div>Mulheres assumem postos antes privilegiados,</div>\r\n<div>d&atilde;o capote no machismo angolano,</div>\r\n<div>e, claro, tamb&eacute;m empatam homens no &aacute;lcool</div>\r\n<div>&nbsp;</div>\r\n<div>Crian&ccedil;as, o bode expiat&oacute;rio dos problemas</div>\r\n<div>Se n&atilde;o s&atilde;o acusadas de feiti&ccedil;aria</div>\r\n<div>s&atilde;o infectadas com sida</div>\r\n<div>Jornal de Angola ou&nbsp;Maka Angola?&nbsp;</div>\r\n<div>Na Lente! Grande not&iacute;cia!</div>\r\n<div>&nbsp;</div>\r\n<div>No Sambila,</div>\r\n<div>adolescentes fazem richa com catanas na street</div>\r\n<div>Onda de crimes assola a capital do pa&iacute;s</div>\r\n<div>Este &eacute; o mundo do Grand Theft Auto: Kianda City</div>\r\n<div>E, meus irm&atilde;os, n&atilde;o somos n&oacute;s na posse do&nbsp;joystick</div>\r\n<div>&nbsp;</div>\r\n<div>Locais de festas a se tornarem igrejas&nbsp;</div>\r\n<div>Igrejas a se tornarem bord&eacute;is&nbsp;</div>\r\n<div>Entretenimento e empreendimento,</div>\r\n<div>em que somos meros consumidores&nbsp;fi&eacute;is</div>\r\n<div>&nbsp;</div>\r\n<div>Gatuno n&atilde;o &eacute; apenas aquele com arma,</div>\r\n<div>tamb&eacute;m &eacute; aquele que veste o terno</div>\r\n<div>Todo mundo contra todo mundo&nbsp;</div>\r\n<div>a ver se conseguem&nbsp;</div>\r\n<div>passar pela porta do governo&nbsp;</div>\r\n<div>Soldados da fortuna a lutarem pelo sustento&nbsp;</div>\r\n<div>Dar o c&uacute; para ter o c&uacute;&nbsp;no parlamento,</div>\r\n<div>&eacute; o glorioso desejo eterno</div>\r\n<div>&nbsp;</div>\r\n<div>Situa&ccedil;&atilde;o angolana &eacute; um filme de terror</div>\r\n<div>Governo desperta dos mortos</div>\r\n<div>abre luta contra os marimbondos</div>\r\n<div>A popula&ccedil;&atilde;o, como insatisfeito telespectador</div>\r\n<div>&eacute; quem vive o sat&iacute;rico horror</div>\r\n<div>E, nesse filme, adivinha quem &eacute; o director?!&nbsp;</div>\r\n<div>Nada mais do que o&nbsp;exterminador&nbsp;JLO!!</div>\r\n<div>&nbsp;</div>\r\n<div>A gatunice precisa imediatamente</div>\r\n<div>de uma ressignifica&ccedil;&atilde;o</div>\r\n<div>Membros do governo</div>\r\n<div>em neg&oacute;cios obscenos</div>\r\n<div>para ver se palavra \"marimbondo\"</div>\r\n<div>ir&aacute; ganhar a \"Palavra do Ano\"</div>\r\n<div>De tanta concorr&ecirc;ncia,</div>\r\n<div>os kotas ter&atilde;o de optar pelo peculato</div>\r\n<div>&nbsp;</div>\r\n<div>A esperan&ccedil;a &eacute; a &uacute;ltima a morrer</div>\r\n<div>Isto at&eacute; o IVA aparecer</div>\r\n<div>Equidade &eacute; jogo de \"Mete Tira\"</div>\r\n<div>em que a Dona Ana Joaquina brinca</div>\r\n<div>no seu Pal&aacute;cio da Justi&ccedil;a</div>\r\n<div>JLO pediu-nos resil&ecirc;ncia</div>\r\n<div>sem na verdade nos ensinar como</div>\r\n<div>Bem que n&oacute;s tentamos,</div>\r\n<div>at&eacute; vermos aquele bolo...</div>\r\n<div>&nbsp;</div>\r\n<div>Pretas e pretos est&atilde;o se amando,</div>\r\n<div>lavando o cabelo da cor do pecado</div>\r\n<div>Muitos n&atilde;o sabem,</div>\r\n<div>mas foi o profeta quem o disse no passado</div>\r\n<div>que a negritude &eacute; salvaguarda</div>\r\n<div>dos valores culturais</div>\r\n<div>E nota-se, pois, vestimos agora</div>\r\n<div>os panos dos ancestrais</div>\r\n<div>Abertamente falamos das origens dos nossos pais</div>\r\n<div>os seus dialectos, costumes e gastronomias</div>\r\n<div>&nbsp;</div>\r\n<blockquote>\r\n<div>Roubar &eacute; permitido&nbsp;</div>\r\n<div>Falar dos que roubam&nbsp;</div>\r\n<div>&Eacute; proibido!</div>\r\n</blockquote>\r\n<div>&nbsp;</div>\r\n<div>Mambimbi foi um profeta</div>\r\n<div>Manguxi foi um or&aacute;culo</div>\r\n<div>Holden pegou nas bicuatas e deu o voado*</div>\r\n<div>Z&eacute; D&uacute; foi um astuto kalupeteka</div>\r\n<div>JLO &eacute; o prometido&nbsp;pastor das ovelhas</div>\r\n<div>J&aacute; se pode notar o padr&atilde;o</div>\r\n<div>E n&oacute;s a pensar que somos um Estado Laico</div>\r\n<div>S&oacute; que n&atilde;o!</div>\r\n<div>Somos governados pela mesma religi&atilde;o</div>\r\n<div>\"O Reino do Maribondismo\"</div>\r\n<div>alocando ceguidores* para o seu plano de ac&ccedil;&atilde;o</div>\r\n<div>[...]</div>\r\n<div>Se Angola fosse N&aacute;rnia,</div>\r\n<div>a profecia finalmente</div>\r\n<div>se cumpriria, a dinastia continuaria</div>\r\n<div>e as palavras do velho or&aacute;culo</div>\r\n<div>finalmente sentido fariam:</div>\r\n<div>&nbsp;</div>\r\n<blockquote>\r\n<div>\"Havemos de Voltar\"</div>\r\n</blockquote>','estado-da-nacao',1,162,'2019-12-30 01:52:01','2022-11-30 13:01:47','v1577670355/rtandrew-site/textos/posters/Estado_da_Na%C3%A7%C3%A3o.png'),(111,'Uma Morte Anunciada','<p>Aos olhos peregrinos <br />sou um mundano moribundo,<br />atravessando buracos profundos,<br />pouco se lixando <br />com as repercuss&otilde;es do futuro <br />&nbsp;<br />Que nem uma bela poesia,<br />encarcerada, dentro de uma caixa, <br />sem vida, perdida, <br />sem chance de ser encontrada, <br />vivo na mais abismal escurid&atilde;o,<br />de segunda a domingo<br />em aguda depress&atilde;o, <br />perguntando-me o que seria &lt;&lt;se&gt;&gt;<br />se os planos n&atilde;o tivessem falido...<br /><br />&Agrave;s vezes desejo&nbsp;morrer, <br />mas s&atilde;o tantos problemas<br />que ela acaba se tornando<br />a &uacute;ltima na lista de afazeres <br /><br />Ent&atilde;o, perece uma nova esperan&ccedil;a, <br />nasce mais um sentimento de vingan&ccedil;a<br />Este, por&eacute;m, &eacute; engolido pela garganta, <br />ficando inerte, para sempre, nas entranhas<br /><br />Nunca perdi ningu&eacute;m na vida <br />N&atilde;o obstante a morte e o futuro <br />serem os meus maiores medos<br />A morte dos pais, dos irm&atilde;os, <br />dos amigos e dos filhos <br />O medo da carreira fracassada,<br />de amar e n&atilde;o ser amado<br />O medo do div&oacute;rcio, <br />e outras coisas do quotidiano... <br /><br />Rumo numa jornada&nbsp;solit&aacute;ria, <br />enfrentando fantasmas na hora do dia<br />Sinto que minha presen&ccedil;a <br />causa rep&uacute;dio &agrave; luz ensolarada...<br />Pudera! Sou um homem sem cren&ccedil;a,<br />c&eacute;tico de tudo que me entra na cabe&ccedil;a<br /><br />Os comprimidos, <br />que antes ajudavam-me a dormir<br />e suavizar o meu fim,<br />hoje j&aacute; n&atilde;o fazem efeito algum<br />Ent&atilde;o, a prescri&ccedil;&atilde;o do doutor passou a ser: <br />&lt;&lt;sorrir&gt;&gt;<br /><br />O sorriso, lentamente, <br />transformou-se em risadas<br />para esconder o choro seco e as m&aacute;goas<br />Infelizmente nessas risadas, sou uma corrente rasa...<br />Que adianta?! Se tudo que julgo passar, n&atilde;o passa!!</p>','uma-morte-anunciada',0,136,'2020-03-23 15:17:00','2022-11-29 14:40:42','v1584976043/rtandrew-site/textos/posters/Uma_Morte_Anunciada.png');
